import "./App.css";
import DiaryEditor from "./DiaryEditor";
import DiaryList from "./DiaryList";

const dummyList = [
  {
    id: 1,
    author: "우정균",
    content: "hi",
    emotion: 2,
    created_date: new Date().getTime(),
  },
  {
    id: 2,
    author: "김정균",
    content: "hi123",
    emotion: 3,
    created_date: new Date().getTime(),
  },
  {
    id: 3,
    author: "박정균",
    content: "helloworld",
    emotion: 4,
    created_date: new Date().getTime(),
  },
  {
    id: 4,
    author: "이정균",
    content: "hiworld",
    emotion: 5,
    created_date: new Date().getTime(),
  },
];

function App() {
  return (
    <div className="App">
      <DiaryEditor />
      <DiaryList diaryList={dummyList} />
    </div>
  );
}

export default App;
